import React, { Component } from "react";
import { Container, Box } from "@material-ui/core";

class login extends Component {
  render() {
    return (
      <Container maxWidth="sm">
        <Box bgcolor="primary.main">login</Box>
      </Container>
    );
  }
}

export default login;
